import * as React from "react";
import Typography from "@mui/material/Typography";
import { Container } from "@mui/material";
import Card from "@mui/material/Card";
import CardActionArea from "@mui/material/CardActionArea";
import CardContent from "@mui/material/CardContent";
import Grid from "@mui/material/Grid";
import { useParams, useNavigate } from "react-router-dom";
import axios from "axios";

interface Props {
  setLoggedIn: React.Dispatch<React.SetStateAction<boolean>>;
}

const PetList: React.FC<Props> = ({ setLoggedIn }) => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [PetId] = React.useState(id);
  const [PetInfo, setPetInfo] = React.useState([]);

  React.useEffect(() => {
    async function fetchData() {
      try {
        const token = localStorage.getItem("token");
        const { data } = await axios.get(
          `http://127.0.0.1:3002/api/v1/Pet?id=${PetId}`,
          {
            headers: {
              Authorization: "Bearer " + token,
            },
          }
        );
        setPetInfo(data);
      } catch {
        setLoggedIn(false);
        navigate("/");
      }
    }
    fetchData();
  }, [PetId, navigate, setLoggedIn]);
  return (
    <Container>
      <Grid item xs={12} md={12} marginTop={2}>
        <CardActionArea component="a" href="#">
          <Card sx={{ display: "flex" }}>
            <CardContent sx={{ flex: 1 }}>
              <video autoPlay controls width="200">
                <source
                  src={`http://localhost:3002/api/v1/video/${PetInfo}`}
                  type="video/mp4"
                />
              </video>
            </CardContent>
          </Card>
        </CardActionArea>
      </Grid>
      {/* <Grid container spacing={2} marginTop={2}>
        <Grid item xs={12} md={6}>
          <Typography variant="subtitle1" color="primary">
            Created by:{PetInfo.createdBy?.fullname}
          </Typography>
        </Grid>
        <Grid item xs={12} md={6}>
          <Typography variant="subtitle1" color="primary">
            Created: {videoInfo.uploadDate}
          </Typography>
        </Grid>
        <Grid item xs={12} md={12}>
          <Typography variant="h5">{videoInfo.title}</Typography>
        </Grid>
      </Grid> */}
    </Container>
  );
};
export default PetList;
